CREATE TABLE IF NOT EXISTS `app_product` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `name` varchar(100) NOT NULL, `description` text NOT NULL, `price` decimal NOT NULL, `image` varchar(100) NULL, `category` varchar(50) NOT NULL, `stock` integer unsigned NOT NULL CHECK (`stock` >= 0));
CREATE TABLE IF NOT EXISTS `app_salesreport` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `date` date NOT NULL, `total_sales` decimal NOT NULL, `total_orders` integer unsigned NOT NULL CHECK (`total_orders` >= 0));
CREATE TABLE IF NOT EXISTS `app_table` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `table_number` varchar(10) NOT NULL UNIQUE, `qr_code` varchar(100) NULL);
CREATE TABLE IF NOT EXISTS `app_customuser` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `password` varchar(128) NOT NULL, `last_login` datetime NULL, `is_superuser` bool NOT NULL, `username` varchar(150) NOT NULL UNIQUE, `first_name` varchar(150) NOT NULL, `last_name` varchar(150) NOT NULL, `email` varchar(254) NOT NULL, `is_staff` bool NOT NULL, `is_active` bool NOT NULL, `date_joined` datetime NOT NULL, `role` varchar(10) NOT NULL);
CREATE TABLE IF NOT EXISTS `app_customuser_groups` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `customuser_id` bigint NOT NULL REFERENCES `app_customuser` (`id`) DEFERRABLE INITIALLY DEFERRED, `group_id` integer NOT NULL REFERENCES `auth_group` (`id`) DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS `app_customuser_user_permissions` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `customuser_id` bigint NOT NULL REFERENCES `app_customuser` (`id`) DEFERRABLE INITIALLY DEFERRED, `permission_id` integer NOT NULL REFERENCES `auth_permission` (`id`) DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS `app_payment` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `payment_method` varchar(50) NOT NULL, `amount_paid` decimal NOT NULL, `payment_date` datetime NOT NULL, `payment_status` varchar(50) NOT NULL, `order_id` bigint NOT NULL UNIQUE REFERENCES `app_order` (`id`) DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS `app_orderdetail` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `quantity` integer unsigned NOT NULL CHECK (`quantity` >= 0), `price` decimal NOT NULL, `order_id` bigint NOT NULL REFERENCES `app_order` (`id`) DEFERRABLE INITIALLY DEFERRED, `product_id` bigint NOT NULL REFERENCES `app_product` (`id`) DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS `app_cart` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `quantity` integer unsigned NOT NULL CHECK (`quantity` >= 0), `date_added` datetime NOT NULL, `user_id` bigint NOT NULL REFERENCES `app_customuser` (`id`) DEFERRABLE INITIALLY DEFERRED, `product_id` bigint NOT NULL REFERENCES `app_product` (`id`) DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS `django_admin_log` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `object_id` text NULL, `object_repr` varchar(200) NOT NULL, `action_flag` smallint unsigned NOT NULL CHECK (`action_flag` >= 0), `change_message` text NOT NULL, `content_type_id` integer NULL REFERENCES `django_content_type` (`id`) DEFERRABLE INITIALLY DEFERRED, `user_id` bigint NOT NULL REFERENCES `app_customuser` (`id`) DEFERRABLE INITIALLY DEFERRED, `action_time` datetime NOT NULL);
CREATE TABLE IF NOT EXISTS `django_session` (`session_key` varchar(40) NOT NULL PRIMARY KEY, `session_data` text NOT NULL, `expire_date` datetime NOT NULL);
CREATE TABLE IF NOT EXISTS `app_customerotpsession` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `phone_number` varchar(20) NOT NULL, `otp_code` varchar(6) NOT NULL, `created_at` datetime NOT NULL, `expires_at` datetime NOT NULL, `is_verified` bool NOT NULL, `session_token` varchar(64) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS `app_order` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `total_price` decimal NOT NULL, `payment_status` varchar(50) NOT NULL, `source` varchar(10) NOT NULL, `notes` text NULL, `phone_number` varchar(15) NULL, `date_ordered` datetime NOT NULL, `kasir_id` bigint NULL REFERENCES `app_customuser` (`id`) DEFERRABLE INITIALLY DEFERRED, `user_id` bigint NULL REFERENCES `app_customuser` (`id`) DEFERRABLE INITIALLY DEFERRED, `table_id` bigint NULL REFERENCES `app_table` (`id`) DEFERRABLE INITIALLY DEFERRED, `payment_method` varchar(20) NOT NULL, `status` varchar(50) NOT NULL, `customer_name` varchar(100) NULL);
